import React from "react";
import { Box } from "@mui/material";
import SpellRow from "./SpellRow";
import { Spell, spellKey } from "../../../types/Spell";

interface SpellOrderProps {
  championName: string;
}

const SpellOrder: React.FC<SpellOrderProps> = ({ championName }) => {
  const baseURL =
    "https://raw.communitydragon.org/latest/plugins/rcp-be-lol-game-data/global/default/assets/characters/" +
    championName +
    "/hud/icons2d/" +
    championName;
    let qSpell : Spell = {
      id: 0,
      name: "Command : Attack",
      icon: baseURL + "q.png",
      spellKey: spellKey.Q,
    };
  return <Box sx={{ display: "flex", gap: 1, flexDirection: "column" }}>
    <SpellRow spell={ qSpell } championName={championName} />
  </Box>;
};

export default SpellOrder;
